import React, { Component } from 'react';
import '../sass/styles.css';
import gif from '../prenuvo_db/862625ef/1361ae6e/bw-gif.gif'
import listReactFiles from 'list-react-files'


export default class App extends Component {
  render() {
    listReactFiles('../prenuvo_db/862625ef/1361ae6e').then(files => console.log(files))
    return (
      <div>
       <h1>IMAGES</h1> 
        <div>
          <img src={gif} alt="prenuvo" />
        </div>

      </div>
    )
  }
}
